      name: "productSizeQuantity",
      title: "Product Size & Quantity",
      type: "productSizeQuantity",
    },
    {
      name: "productWeight",
      title: "Product Weight",
      type: "number",
      validation: (Rule) => Rule.required(),
    },
  ],
};

